import React, { useState } from "react";
import axios from "axios";
import { Link,useNavigate } from "react-router-dom";

function Display_U() {
  let items = {
    "user 1": "operator",
    "user_2": "admin",
    "user_3": "reviewer",
  };// this is where the users will go

  const [formData, setFormData] = useState ({
    username: '',
    password: ''
  });
  const handleLogin = async e => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/display_U', formData);
      console.log(response.data)
      // updateFlag(true)
      // navigate("/home")
    } catch (error) {
      console.error("Loging Error:", error)
    }
  }

  return (
    <div
      style={{
        height: "80vh",
      }}
    >
      <h1>Users</h1>
      <ul>
        {Object.entries(items).map(([key, value]) => (
          <li key={key}>
            {key}: {value}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Display_U;
